import React from 'react';


const Roster = (props) => {
    return (
        <div>
            <h1>rOASTER</h1>
        </div>
    );
};

Roster.getInitialProps = async function({store}) {
    const res = await fetch('http://data.nba.net/10s/prod/v1/2019/players.json');
    const data = await res.json();

    return {
        stats: data.league
    };
}
export default Roster;
